description:
A range of physical, chemical and biological data was collected during four approximately week- long trips from June to September 2008.

Two temperature- pressure loggers sampling at 30 s intervals (SBE39, Seabird Electronics) were deployed from 27 June 2008 to 26 August 2008 near Champagney and MacIntyre Islands in 23 m and 22.7 m of water, respectively.

Hydrographic surveys of temperature, salinity (SBE19plus, Seabird Electronics) , turbidity and chlorophyll a fluorescence via repeated boat-based transects were completed over the Camden Sound/ Montgomery Reef area during four approximately week-long trips:

- Trip 1: 27/06/08 – 02/07/08;
- Trip 2: 31/07/08 – 04/08/08;
- Trip 3: 25/08/08 – 29/08/08 and;
- Trip 4: 17/09/08 – 22/09/08. 

The total number of casts collected was approximately 200.
